function [force, goal] = fcn(ball_velocity,robot_position, ball_position)
%#eml
% Initialize variables

force1=zeros(2,1);
force2=zeros(2,1);
force3=zeros(2,1);
force4=zeros(2,1);
collision_force=zeros(2,1);
d1=zeros(2,1);
d2=zeros(2,1);
d3=zeros(2,1);
d4=zeros(2,1);
K=100;
goal=0;
tol=25;
B=0.01;

% Compute dot products and calculate impulsive forces on the ball
d1=robot_position(1:2,1)-ball_position;
d2=robot_position(3:4,1)-ball_position;
d3=robot_position(5:6,1)-ball_position;
d4=robot_position(7:8,1)-ball_position;

if   dot(d1,d1) <tol
     force1=-K*d1;
end

if   dot(d2,d2) <tol
     force2=-K*d2;
end

if   dot(d3,d3) <tol
     force3=-K*d3;
end

if   dot(d4,d4) <tol
     force4=-K*d4;
end

% Code to check for boundary collisions for the ball
if ball_position(1,1)<0 
    collision_force(1,1)=-K*ball_position(1,1);
end

if ball_position(1,1)>200 
    collision_force(1,1)=K*(200-ball_position(1,1));
end

if ball_position(2,1)<0 
    collision_force(2,1)=-K*ball_position(2,1);
end

if ball_position(2,1)>100 
    collision_force(2,1)=K*(100-ball_position(2,1)); 
end

% Total force
force=collision_force+force1+force2+force3+force4-B*ball_velocity;

% Goal scored
if ((ball_position(1,1)<=0) && (ball_position(2,1)>41) && (ball_position(2,1)<59))
    goal=1; 
end

if ((ball_position(1,1)>=200) && (ball_position(2,1)>41) && (ball_position(2,1)<59))
    goal=1; 
end

function collision_force = fcn(robot_position)
%#eml
K=100;
collision_force=[0; 0]; 
if robot_position(1,1)<0 
    collision_force(1,1)=-K*robot_position(1,1);
end

if robot_position(1,1)>200 
    collision_force(1,1)=K*(200-robot_position(1,1));
end

if robot_position(2,1)<0 
    collision_force(2,1)=-K*robot_position(2,1);
end

if robot_position(2,1)>100 
    collision_force(2,1)=K*(100-robot_position(2,1));
end

